import React from "react";
import { TopSection } from "./TopSection";
import styled from "styled-components";

const homeContainer = styled.div`
    width: 100%;
    height: 100%;
    display: flex;
    flex-direction: column;
`;

export function Homepage(props) {
    return <HomeContainer>
        <TopSection />
    </HomeContainer>
}
